text:
Dersom dere ikke lar ungdommene ta hjemmeskole i tiden før jul,  må  #munnbind innføres!
Hvis hjemmeskole før jul- kan man innføre at alle må gå alene i butikker. 
Munnbind overalt innendørs!
@BentHHoyre 
@gurimelby 
@Helsedir

@asbjornu @r_CallofDuty @CSpange @Fotballgubbe @AJHaukenes @Hros @amstradsen @GardRotmo Det er konkludert tydelig at klorokin ikkje hjelper i akuttfasen, usikker på om det også er konkl ang profylakse.
Ang masker er det usikkert om det beskytter deg, men det red smitte frå sjuke.

Husk at INGEN ynskjer å bli operert av ein kirurg utan munnbind....Abs ingen.

@vannkoker Jeg betaler omtrent det du vil ha, om du klarer å lage ett munnbind som passer for oss med skjegg. Viktig at det går litt lengre mot ørene, og som en "pose" under med ekstra strikk. Om mulig i sort.
Tror det kan være et markedspotensiale, for jeg har lett lenge etter det!
. https://t.co/U0mBOWWRC4

@HalSandberg Min tro :
Ut fra de opplysningene som kom fra Italia tidlig i pandemien tror jeg at mengden smitte som pustes inn har betydning for forløpet av sykdommen i minst noen tilfeller.
Og derfor er jeg for bruk av munnbind, ansiktsmaske og for avstandsregelen 2 meter.

@PatrickVenholdt Okei, beklager at jeg har brukt utydelig retorikk.❤️
Jeg skjønner alvoret, og oppfordrer alle mine venner til å være så forsiktige som mulig, og ta ansvar.

Det betyr ikke at regjeringen skal gi folk bot hvis de går uten munnbind, slik de gjør i Bergen nå.

@intoleranse Ingen av delene. 
Kanskje jeg burde uttrykket meg annerledes, men moter har aldri hatt plass i mitt liv :-)
Jeg tenkte derimot på at folk har fått opp øynene for at munnbind er noe en faktisk kan bruke.

@diamantisen @BentHHoyre Håper du/vi får svar fra @BentHHoyre. 

Har kun hørt argumentet med at det ikke har vært smittespredning i hjemmetjenesten/hjspl, så derfor ikke nødvendig med så strenge tiltak, munnbind/beskyttelse etc. 
@StHerm har fulgt bedre med enn meg.

Sånn oppleves det å bli sendt i krigen, uten annet enn to munnbind per dag, for beskyttelse av opp mot 20 ulike pasienter -og egen helse. 

@spro_helene @helenesan @BentHHoyre @erna_solberg 

https://t.co/JdFMw4dBVj

